import './Profile.css';
import './style.css';


import { Link } from "react-router-dom";

import CurrentLinks from './currentLinks';

export default function ProjectEntry(props, setCurrentCat) {

    let link = `/${props.name}`

    return (
        <Link to={link}>
            <button className="section-entry" key={props.id}  onClick={() => setCurrentCat(props.name)}>
                <img className="entry-image" src={"./content/" + props.src} />
                <div className="entry-title">{props.name}</div>
                <div className="entry-desc">{props.desc}</div>
              
            </button>
           
        </Link>

    );

};
